package leetcode.算法.双指针;

import org.junit.Test;

import java.util.HashMap;
import java.util.Map;

/**
 * @author lzh
 * @date 2020/11/3 9:40
 */
public class 最小覆盖子串_76 {

    /**
     * 双指针，滑动窗口。参考别人题解（好好学习）
     * 2ms 100%    38.7M 94.48%
     */
    public String minWindow(String s, String t) {
        int slen, tlen;
        if(s == null || s == "" || t == null || t == "" || (slen = s.length()) < (tlen = t.length())) {
            return "";
        }

        // 注意：
        // (1) t 是可能包含重复字符的

        int lp = 0, rp = 0;
        int count = 0;
        int minCount = slen;
        String res = "";

        // 存储 t 中的字符极其个数，用于快速判断某个字符是否在 t 中
        int[] need = new int[128];
        // 维护窗口中的字符
        int[] window = new int[128];

        char[] sArr = s.toCharArray();
        char[] tArr = t.toCharArray();

        for(char c : tArr) {
            need[c]++;
        }

        while(rp < slen) {

            char c = sArr[rp];
            if(++window[c] <= need[c]) {
                count++;
            }

            // 已经包含T中所有
            if(count == tlen) {
                // 可以移动 lp
                while(lp < rp && window[sArr[lp]] > need[sArr[lp]]) {
                    window[sArr[lp]]--;
                    lp++;
                }

                // 更新最小子串
                if(rp - lp + 1 <= minCount) {
                    minCount = rp - lp + 1;
                    res = s.substring(lp, rp + 1);
                }

                // lp 再向右移动，使之不满足
                window[sArr[lp]]--;
                lp++;
                count--;
            }

            // 移动右指针
            rp++;
        }

        return res;

    }

    /**
     * 框架式代码
     *
     * 滑动窗口算法的思路是这样：
     *
     * 1、我们在字符串S中使用双指针中的左右指针技巧，初始化left = right = 0，把索引左闭右开区间[left, right)称为一个「窗口」。
     *
     * 2、我们先不断地增加right指针扩大窗口[left, right)，直到窗口中的字符串符合要求（包含了T中的所有字符）。
     *
     * 3、此时，我们停止增加right，转而不断增加left指针缩小窗口[left, right)，直到窗口中的字符串不再符合要求（不包含T中的所有字符了）。同时，每次增加left，我们都要更新一轮结果。
     *
     * 4、重复第 2 和第 3 步，直到right到达字符串S的尽头。
     *
     * 这个思路其实也不难，第 2 步相当于在寻找一个「可行解」，然后第 3 步在优化这个「可行解」，最终找到最优解，
     * 也就是最短的覆盖子串。左右指针轮流前进，窗口大小增增减减，窗口不断向右滑动，这就是「滑动窗口」这个名字的来历。
     *
     * 套模板时，只需要思考以下四个问题：
     * ​
     * 1、当移动right扩大窗口，即加入字符时，应该更新哪些数据？
     * ​
     * 2、什么条件下，窗口应该暂停扩大，开始移动left缩小窗口？
     * ​
     * 3、当移动left缩小窗口，即移出字符时，应该更新哪些数据？
     * ​
     * 4、我们要的结果应该在扩大窗口时还是缩小窗口时进行更新？
     *
     *     void slidingWindow(String s, String t) {
     *
     *         Map<Character, Integer> need = new HashMap<>(), window = new HashMap<>();
     *         for(char c : t.toCharArray()) {
     *             need.put(c, need.getOrDefault(c, 0) + 1);
     *         }
     *
     *         int left = 0, right = 0;
     *         int valid = 0;
     *         while (right < s.length()) {
     *             // c 是将移入窗口的字符
     *             char c = s.charAt(right);
     *             // 右移窗口
     *             right++;
     *             // 进行窗口内数据的一系列更新
     *             ...
     *
     *             // debug 输出的位置
     *             System.out.println("window: ["+left +","+right +")");
     *
     *             // 判断左侧窗口是否要收缩
     *             while(window needs shrink){
     *                 // d 是将移出窗口的字符
     *                 char d = s.charAt(left);
     *                 // 左移窗口
     *                 left++;
     *                 // 进行窗口内数据的一系列更新
     *                 ...
     *              }
     *          }
     *      }
     */


    /**
     * 框架式编码【忽略优化】
     */
    public String minWindow_frame(String s, String t) {

        // 用框架来做
        // 先不管优化的问题，如使用数组比用 Map 更快之类的

        Map<Character, Integer> need = new HashMap<>(), window = new HashMap<>();

        for(char c : t.toCharArray()) {
            need.put(c, need.getOrDefault(c, 0) + 1);
        }

        int lp = 0, rp = 0;
        int valid = 0;
        int begin = 0, len = Integer.MAX_VALUE;

        while(rp < s.length()) {

            // c 是将移入窗口的字符
            char c = s.charAt(rp);
            // 右移窗口
            rp++;
            // 进行窗口内数据的一系列更新
            if(need.containsKey(c)) {
                window.put(c, window.getOrDefault(c, 0) + 1);
                if(need.get(c).equals(window.get(c))) {
                    valid++;
                }
            }

            // 判断左侧窗口是否要收缩
            while(valid == need.size()) {

                // 在这里更新最小覆盖子串
                if(rp - lp < len) {
                    begin = lp;
                    len = rp - lp;
                }

                // d 是将移出窗口的字符
                char d = s.charAt(lp);
                // 左移窗口
                lp++;
                // 进行窗口内数据的一系列更新
                if(need.containsKey(d)) {
                    if(need.get(d).equals(window.get(d))) {
                        valid--;
                    }
                    window.put(d, window.get(d) - 1);
                }
            }

        }

        return len == Integer.MAX_VALUE ? "" : s.substring(begin, begin + len);
    }

    @Test
    public void test() {
        String s = "";
        String t = "";
        String res = minWindow_frame(s, t);

        String expect = "";
        System.out.println("=====================================================");
        System.out.println(res.length());
        System.out.println(expect.length());
        assert res.equals(expect);
    }
}
